import React, { Component } from "react";
import { Button } from "react-bootstrap";
import Link from "next/link";

class UserCard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <div></div>
      </div>
    );
  }
}

export default UserCard;
